class Botonmas extends Component{
	adder(){
		console.log("kek");
	}

	render(){
		return(
			<form autoComplete="off"  onSubmit={this.adder}>
				<Fab
					color="primary"
					size="large"
				/>
			</form>
		)
	}
}

export default Botonmas
